                ans.push(t.join('.'));
            }
            return;
        }
        for (let i = 1; i <= Math.min(4, s.length + 1); i++) {
            if (check(s.slice(0, i))) {
                t.push(s.slice(0, i));
                dfs(s.slice(i), t);
                t.pop();
            }
        }
    }
    let ans = [];
    dfs(s, []);
    return ans;
}
